import React, { useEffect, useState } from "react";

import Homepage_Btn from './Homepage_Btn.js'

export const My_Reviews = (props) => {

    const [REVIEWS ,updateREVIEWS] = useState([])

    useEffect(async ()=>{
    
        let USER;
        if(props.id){USER = props.id.userinfo
        console.log(USER)
        const result = await Fetch_Posted_Reviews(USER.name)
        console.log(result)
        }

    },[])

    const Review_Container = (props) => {

        console.log(props)

        switch(props.status){
            case('unverified'):
            return;

            case('verified'):
            const result = props.action(props.user_id)
            console.log(result)
            return <React.Fragment>

            <div></div>

            </React.Fragment>

        }

    }

    const Fetch_Posted_Reviews = async (user_name) =>{

        const Review_Posted = await fetch(`/read_reviews/${user_name}`,{
            method: 'GET',
            headers:{
                'Content-Type': 'application/json'
            }
        })

        const result = await Review_Posted.json();

        return result

    }

    const Dispense_Review_Data = (input)=>{

        let USER;

        if(input.id){ USER = input.id}

        switch(USER.status){
        case('unverified'):
            return;
        
        case('verified'):
            USER = USER.userinfo
            return <Review_Container
                status='verified'
                user_id={USER.id}
                action={async (e)=>{return await Fetch_Posted_Reviews(e)}}
            />;

        case('undefined'):
            return;

        default:
            return;
    }
}

    return <React.Fragment>

        <div
        className="Personalize_Data_Page_Container"
        >

            <Homepage_Btn/>

            <div
            className="Personalized_Data_Container_Aligner"
            >
                <span
                className="Personalized_Data_Page_TextTitle"
                >
                My Reviews
                </span>
                <br></br>

                <span
                className="Personalized_Data_Page_TextTitle"
                >
                This Page
                <br></br>
                is Preparing
                </span>
            
                {/* {Dispense_Review_Data(props)} */}
                

            </div>

        </div>

    </React.Fragment>

}

export default My_Reviews
